      | 365433 -> { ItemTypeData.id= 365433; name= "Passive Omega-Booster (30-Day)"; published= false; description= "Boosters are biomechanical grafts designed to stimulate nerve growth and neurotransmitter activity, temporarily increasing cognitive processes. The graft will degrade over time until it is completely absorbed by the body and ceases to function.    Passive Boosters increase the rate of passive skill point accrual while they are active. Omega-Boosters feature superior performance over standard models.    NOTE: Passive boosters will continue to function on non-primary clones as a factor of the base skillpoint accrual rate. (Non-primary clones without a passive skill booster do not accrue skill points at all.)    "; marketGroupId= None; groupId= 354641; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 365627 -> { ItemTypeData.id= 365627; name= "'Construct' Wiyrkomi Swarm Launcher"; published= false; description= "A mid-range anti-material weapon, the shoulder-mounted rocket launcher provides infantry squads with the means to effectively engage armored vehicles and installation gun emplacements. With pre-launch lock-on capabilities and intelligent swarm missiles, it is a man-portable system able to deliver devastating payloads against material targets.    Key to its success is the swarm missile technology. Fired in salvos, each warhead is fitted with an onboard guidance controller, which introduces random deviations and unpredictable patterns into the swarm's flight path, allowing some, if not all, missiles in the salvo to defeat basic countermeasure systems."; marketGroupId= None; groupId= 350858; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
