      | 366500 -> { ItemTypeData.id= 366500; name= "State C15-A Tactical Sniper Rifle"; published= false; description= "Using microscale railgun technology, the sniper rifle effectively weaponizes velocity, putting an inert round downrange in excess of 2,500m/s. The standard round is a 2-inch ‘beehive' flechette, loaded automatically from a center-mount pack. The pack design eliminates user intervention and minimizes reload time while simultaneously allowing for future upgradeability; different ammunition configurations require nothing more than switching out the rifle's pack."; marketGroupId= None; groupId= 350858; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
