      | 367955 -> { ItemTypeData.id= 367955; name= "State 'Rasetsu' Assault"; published= false; description= "The Assault dropsuit is a versatile frontline combat suit that combines excellent protection, good mobility, and sufficient hard points for mission-specific customizations.    A flat-coil e5000 fifth generation fusion core runs up the inside of the back plate, powering the entire suit. Its output and heat buildup are controlled by a L2 “Gatekeeper” regulator conduit, which connects directly to the sensor system at the base of the neck. Every joint is reinforced with kinetic sensors and two-way, high torque servos to enhance the soldier’s strength, balance, and resistance to impact forces. The suit’s helmet has more integrated sensor, communication, targeting, and data processing systems than most civilian vehicles. As is common with Caldari designs, armor plating is limited to vital areas, relying instead on high-power shield systems to protect the wearer.    Assault dropsuits are intended for standard combat operations or those in which the objectives are likely to change at a moment’s notice. Its ability to carry anything from small arms and explosives to anti-vehicle munitions and deployable support gear makes it the most adaptable direct combat suit on the battlefield."; marketGroupId= None; groupId= 367594; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 36797 -> { ItemTypeData.id= 36797; name= "Nomad Valklear Glory SKIN (Permanent)"; published= true; description= ""; marketGroupId= Some(2098); groupId= 1950; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 368537 -> { ItemTypeData.id= 368537; name= "'Quafe' Saga"; published= false; description= "The Light Attack Vehicle (LAV) represents a new generation of mobile support vehicle, an agile and effective unit, adept at assisting both infantry and other vehicles on the battlefield with its cadre of electronic warfare subsystems and all-terrain maneuverability modules. Whether employed as a scout vehicle or as an anti-infantry unit, the LAV is a ubiquitous part of New Eden's modern battlefield."; marketGroupId= None; groupId= 351210; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 368634 -> { ItemTypeData.id= 368634; name= "Federation Sentinel G-I"; published= false; description= "The Sentinel dropsuit is a second-generation solution designed to withstand concentrated small arms fire and protect the wearer from the concussive, thermal, and impact forces of low-grade explosives. Additionally, its power-assisted exoskeleton facilitates usage of the heaviest caliber personal weapons.    Enhanced to withstand kinetic and fragmentary impacts with minimal deformation, Gallente Sentinel technology offers the best armor protection currently available in the cluster. Ablative surfacing helps deflect incoming fire and ultra-efficient armor composites and electrically charged active protection plates increase survivability in even the most dangerous combat situations.    Heavy dropsuits lack the mobility of lighter suits, but this trade-off results in a defensive system that defies standard infantry conventions. No other classification of personal armor can claim to be able to stand toe-to-toe with enemy vehicles and survive."; marketGroupId= None; groupId= 351064; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
